text:
제목이 곧 내용입니다
이거 왜 이러는거예요
틴더 본사로도 문의했는데 답변 안옴;;;;

아니 본인 맞는데 계정 삭제 당하고 영구적으로 못만드는 지경이 됐네요?
사진 찍으라는 대로 찍었는데 뭐가 문제인지…
재밌는 분들이랑 이야기 하다가 끊겼어요 ;;;;

앱이라도 쓰게 해주지 진짜 뭐임 ㅠㅠ 
결제까지 했었는데 들어가질 못 하면 환불도 못 하잖아요 15시간 넘게 검토 중인데 이게 대체 뭐냐고요,,,
셀카로 그렇게 사기 친 정도도 아닌데 이러다 계정 차단 당하면 돈도 못 받잖아요 ㄹㅇ 삼만원이 넘는 돈인데 이게 뭐죠 대체;;

저는 틴더로 욕도 안 하고 건전하게 사용했는데 
검토 확인 시간 하루 정도 지금 하고 있거든요 
왜이러는거죠;;;

결제 갱신된지 일주일만에 이유도 없이 경고도 없이 일방적으로 영구정지 시켜놓고 고객센터에 메일까지 보내서 정지 안풀어줘도 좋으니까 이유라도 알려달라니까 규정상 알려줄수없다구요? 요금먹고 째는게 당신들 규정인가요? ㅋㅋ 아무리생각해도 규정을 위반한게 없는데 정지를 무슨생각으로 하는지도모르겠고 정지를 시킬거면 요금을 환불을 해주시던지요;; 월 요금으로 했으니까 망정이지 몇개월치씩 끊는사람같았으면 더 열받았을거같아요 
그냥 악의적으로 보일때마다 신고하면 그사람 정지되는거같던데 정지되는사람은 그냥 당하고만있어야되는거면 시스템 본인들이 이상하게만들어놓고 왜 대처도 안해요? 일을하세요;;
지금 후기낮은순으로 보면 알겠지만 결제하면서 오래쓰던 유저들 최근들어 이유도없이 영구정지되는 사례가 계속 생기는거보면 모르겠어요? 당신들이 만든 인식시스템이 개판이거나 뭔가 문제가 있다는거잖아요 그럼 처음엔 아니더라도 데이터가 쌓이면 저런 이유로 문의하는사람들한테 무조건 안된다고하지말고 정지를 풀어주던가 아니면 맞는 대처를 해줘야되는데 “절대안돼!” “영구정지!” 이러고만 있는게 맞는거에요? 일좀해요. 최근에 이유없이 정지당한사람이 한둘이 아니구만…
